import Header from '~/pages/header/Header';
import './carts.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fa1, fa2, fa3, faCartShopping, faCircle } from '@fortawesome/free-solid-svg-icons';

function Carts({ isLoggedIn, username }) {
    // Lấy phần tử span chứa số lượng
    const quantitySpan = document.getElementById('quantity');

    // Lấy nút "+" và "-" trong phần tử td
    const btnMinus = document.querySelector('td .btn_minus');
    const btnPlus = document.querySelector('td .btn_plus');

    // Lắng nghe sự kiện click vào nút "-"
    btnMinus.addEventListener('click', function () {
        // Lấy giá trị số lượng hiện tại
        let currentQuantity = parseInt(quantitySpan.textContent);

        // Giảm giá trị số lượng
        if (currentQuantity > 1) {
            currentQuantity--;
            quantitySpan.textContent = currentQuantity;
        }
    });

    // Lắng nghe sự kiện click vào nút "+"
    btnPlus.addEventListener('click', function () {
        // Lấy giá trị số lượng hiện tại
        let currentQuantity = parseInt(quantitySpan.textContent);

        // Tăng giá trị số lượng
        currentQuantity++;
        quantitySpan.textContent = currentQuantity;
    });

    //tính tiền total_money
    const totalMoney = document.getElementsByClassName('total_money');

    return (
        <>
            {isLoggedIn ? (
                <></>
            ) : (
                <>
                    <Header isLoggedIn={isLoggedIn} username={username} />
                </>
            )}

            <div class="container_list_carts">
                <div class="top_infomation">
                    <div class="title_carts">
                        <h3>Giỏ hàng của tôi</h3>
                    </div>
                    <div class="stages_of_cart">
                        <div class="stage_1">
                            <FontAwesomeIcon icon={faCartShopping} />
                            <p>Giỏ hàng của tôi</p>
                            <FontAwesomeIcon icon={fa1} />
                        </div>
                        <div class="stage_2">
                            <i class="fa-solid fa-cart-shopping">cart</i>
                            <p>Giỏ hàng của tôi</p>
                            <FontAwesomeIcon icon={fa2} />
                        </div>
                        <div class="stage_3">
                            <i class="fa-solid fa-cart-shopping">cart</i>
                            <p>Giỏ hàng của tôi</p>
                            <FontAwesomeIcon icon={fa3} />
                        </div>
                    </div>
                </div>
                <div class="bottom_infomation">
                    <div class="section_products_cart">
                        <table class="list_products">
                            <tr>
                                <th></th>
                                <th>Tên sản phẩm</th>
                                <th>Giá cả</th>
                                <th>Số lượng</th>
                                <th>Thành tiền</th>
                            </tr>
                            <tr>
                                <td></td>
                                <td>Sen Đá Dù Viền Hồng</td>
                                <td>50000</td>
                                <td>
                                    <p>
                                        <button class="btn_minus">-</button>
                                        <span id="quantity">1</span>
                                        <button class="btn_plus">+</button>
                                    </p>
                                </td>
                                <td class="total_money">50000</td>
                            </tr>
                        </table>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Carts;
